import { makeStyles } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
        fontFamily: 'Nunito',
        fontSize: 14,
        color: 'white',
        //display: 'flex',
        //justifyContent: 'center',
        alignItems: 'center',
    },
    imageSize: {
        height: 250,
    },
}));

export default useStyles;
